import React from "react";
import ReactDOM from "react-dom";

ReactDOM.render(
   <div>
   <ol>
   <h1> Hello, My Name Is Jatin Thakur </h1>
   <li> Todays date is 16/9/2020 </li>
   <li> current time is 11:25:26 PM </li>
   </ol>
   </div>,
   document.getElementById('root')
   );
